import React from 'react';
import Navbar from '../Home/Navbar';
import Footer from '../Home/Footer';

const Cart = () => {
    return (
        <>
            <Navbar />
            
            <div className='cart_main'>
                <div className='cart_row'>
                    <div className='cartTitles'>
                        <h3>Product</h3>
                        <h3>Quantity</h3>
                        <h3>Subtotal</h3>
                    </div>
                </div>
            </div>

            <Footer />
        </>
    )
}

export default Cart;
